INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(1972, 'The GodFather', 'Francis Ford Coppola', 'Gangsters', '02:55:00', 'The Godfather \\\"Don\\\" Vito Corleone is the head of the Corleone mafia family in New York./n He is at the event of his daughter\\\'s wedding. Michael,/n Vito\\\'s youngest son and \r\na decorated WW II Marine/n is also present at the wedding./n Michael seems to be uninterested in being a part of the family business. /n Vito is a powerful man, and is kind to all those who give him respect but is ruthless against those who do not./n But when a powerful and treacherous rival wants to sell drugs and needs the Don\\\'s influence for the same, Vito refuses to do it. /n\r\nWhat follows is a clash between Vito\\\'s fading old values and the new ways which may cause Michael /n to do the thing he was most reluctant in doing and wage a mob war against all the other/n\r\n mafia families which could tear the Corleone family apart.', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(1989, 'Dead poets society ', 'Peter Weir', 'Drama', '02:08:00', 'Painfully shy Todd Anderson has been sent to the school where /n his popular older brother was valedictorian. /nHis roommate, /n Neil Perry, although exceedingly /n bright and popular, \r\nis very much /n under the thumb of his overbearing /n father. The two, along with their /n other friends, meet Professor Keating, their new English teacher, /n\r\nwho tells them of the Dead Poets Society, and encourages them /n to go against the status quo. /n Each does so in his own way, and is changed for life.', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(1995, 'Seven', 'David Fincher', 'Thriller', '02:07:00', 'A film about two homicide detectives (Morgan Freeman and Brad Pitt) desperate hunt for a serial killer who justifies his crimes as absolution for the world\'s \r\nignorance of the Seven Deadly Sins. The movie takes us from the tortured remains of one victim to the next as the sociopathic \\\"John Doe\\\" (Kevin Spacey) sermonizes to Detectives Somerset and Mills -- one sin at a time. The sin of Gluttony comes first and the murderer\\\'s\r\n terrible capacity is graphically demonstrated in the dark and subdued tones characteristic of film noir. The seasoned and cultured but jaded Somerset researches the Seven Deadly Sins in an effort to understand the killer\\\'s modus operandi while the bright but green and impulsive Detective Mills (Pitt) scoffs at his efforts to get inside the mind of a killer...', );
