INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(1999, 'Star Wars I : The Phantom Menace', 'George Lucas', 'SF', '02:16:17', 'The evil Trade Federation, led by Nute Gunray is planning to take over the peaceful world of Naboo. /n\r\nJedi Knights Qui-Gon Jinn and Obi-Wan Kenobi are sent to confront the leaders. But not everything goes to plan./n \r\nThe two Jedi escape, and along with their new Gungan friend, Jar Jar Binks head to Naboo to warn Queen Amidala,/n\r\n but droids have already started to capture Naboo and the Queen is not safe /n there. Eventually, they land on Tatooine, where they become friends with /n a young boy known as Anakin Skywalker. Qui-Gon is curious about the boy, and /n sees a bright future for him. /n\r\nThe group must now find a way of getting to Coruscant and to finally solve this /n trade dispute, but there is someone else hiding in the shadows. /n\r\nAre the Sith really extinct? /n Is the Queen really who she says she is? /n And what\'s so special about this young boy?', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(2001, 'Shrek', 'Vicky Jenson', 'Animation', '01:30:00', 'When a green ogre named Shrek discovers his swamp has been swamped with all sorts of fairytale creatures by the scheming Lord Farquaad, \r\nShrek sets out with a very loud donkey by his side to \\\'persuade\\\' Farquaad to give Shrek his swamp back. Instead, a deal is made. Farquaad, who wants to become the King, sends Shrek to rescue Princess Fiona, who is awaiting her true love in a tower guarded by a fire-breathing dragon. \r\nBut once they head back with Fiona, it starts to become apparent that not only does Shrek, an ugly ogre, begin to fall in love with the lovely princess,but Fiona is also hiding a huge secret.', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(2003, 'Lost in translation', 'Sofia Coppola', 'Drama', '01:47:00', 'Middle-aged American movie star Bob Harris is in Tokyo to film a personal endorsement Suntory whiskey ad solely for the Japanese market.\r\nHe is past his movie star prime, but his name and image still have enough cachet for him to have gotten this lucrative $2 million job. He has an unsatisfying home life where his wife Lydia follows him wherever he goes - in the form of messages and faxes - for him to deal with the minutiae of their everyday lives, while she stays at home to look after their kids. \r\nStaying at the same upscale hotel is fellow American, twenty-something recent Yale Philosophy graduate Charlotte, her husband John, an entertainment still photographer, who is on assignment in Japan. As such, she is largely left to her own devices in the city, especially when his job takes him out of Tokyo. Both Bob and Charlotte are feeling lost by their current situations, which are not helped by the cultural barriers they feel in Tokyo, those cultural barriers extending far beyond just not knowing the language. \r\nAfter a few chance encounters in the hotel, they end up spending much of their time hanging out together, \r\neach helping the other deal with their feelings of loss in their current lives. The friendship that develops between the two, which is not always a bumpy-free one, may be just for this specific place and time, but it may also have long lasting implications.', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(2006, 'OSS 117 Le Caire nid d espion', 'Michel Hazanavicius', 'Comedy', '01:39:00', 'An homage to classic spy films. It\\\'s 1955 and after a fellow agent and close friend disappears, secret agent Hubert Bonisseur de la Bath, a.k.a. OSS 117, \r\nis ordered to take his place at the head of a poultry firm in Cairo. This is to be his cover while he is busy investigating, foiling Nazi holdouts,quelling a fundamentalist rebellion, and bedding local beauties.', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(2009, 'Gran Torino', 'Clint Eastwood', 'drama', '01:56:00', 'Walt Kowalski (Clint Eastwood) is a widower who holds onto his prejudices despite the changes in his Michigan neighborhood and the world around him. \r\nKowalski is a grumpy, tough-minded, unhappy old man who can\\\'t get along with either his kids or his neighbors.\r\n He is a Korean War veteran whose prize possession is a 1972 Gran Torino he keeps in mint condition.\r\nWhen his neighbor Thao Lor (Bee Vang), a young Hmong teenager under pressure from his gang member cousin, tries to steal his Gran Torino,Kowalski sets out to reform the youth. Drawn against his will into the life of Thao\\\'s family, Kowalski is soon taking steps to protect them from the gangs that infest their neighborhood.', );
INSERT INTO `movie` (`ID_movie`, `Name`, `Director`, `Genre`, `Running_time`, `Synopsis`, `Image`) VALUES
(2014, 'Imitation Game', ' Morten Tyldum', 'biographic', '01:54:00', 'In 1951, Alan Turing created a set of rules for determining the intelligence of a computer. With this theory as a guideline, \r\ntwo scientists test whether their machine has truly learned what it means to be human.', );

